import React from "react";
import { Navbar, Nav, NavDropdown, Button, Container } from "react-bootstrap";
import styled from 'styled-components';

const StyledSideNav = styled.div`   
    position: fixed;     /* Fixed Sidebar (stay in place on scroll and position relative to viewport) */
    height: 100%;
    width: 75px;     /* Set the width of the sidebar */
    z-index: 1;      /* Stay on top of everything */
    top: 3.4em;      /* Stay at the top */
    background-color: #222; /* Black */
    overflow-x: hidden;     /* Disable horizontal scroll */
    padding-top: 10px;
`;

const NavbarHeader = () => {
  return (
    <>
      <Navbar bg="dark" variant="dark">
        <Button variant="primary"></Button>
        <Nav className="me-auto">
          <Nav.Link href="/clients">Clients</Nav.Link>
          <Nav.Link href="/projects">Projects</Nav.Link>
          <Nav.Link href="/employees">Employees</Nav.Link>
        </Nav>
        <Nav>
          <Nav.Link href="">Admin Options</Nav.Link>
          <NavDropdown title="User Name" id="collapsible-nav-dropdown">
            <NavDropdown.Item href="">Action1</NavDropdown.Item>
            <NavDropdown.Item href="">Action2</NavDropdown.Item>
            <NavDropdown.Item href="">Action3</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="">Action4</NavDropdown.Item>
          </NavDropdown>
        </Nav>
        {/* </Navbar.Collapse> */}
      </Navbar>
      <Navbar
        expand="lg"
        defaultActiveKey="/home"
        className="flex-column"
        bg="dark"
        variant="dark"
        id="side-menu"
      >
        <StyledSideNav>
        <row><Nav.Link href="/home">D</Nav.Link></row> {/*Dashboard*/}
        <row><Nav.Link eventKey="">E</Nav.Link></row> {/*Expenses Filed*/}
        <row><Nav.Link eventKey="">A</Nav.Link></row> {/*Analytics*/}
        </StyledSideNav>
      </Navbar>
    </>
  );
};

export default NavbarHeader;
